<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title> Dagole's Professional Website </title>

    <link rel="shortcut icon" href="Foto Perfil.jpg" type="image/x-icon">
    <link class="Estrellas" rel="stylesheet" href="Estrellas.css">

    <style>

        body {

            --Color_Primario: #0c0c0c;
            --Color_Secundario: #191919;
            --Color_Secundario_Complementario: #494949;
            --Color_Blanco: #ffffff;

            background: var(--Color_Primario);
            margin: 0px;
            width: 100%;
            height: 100vh;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: all 1s;
            overflow: hidden;

        }

        div.Instagram {

            --Tamaño: min(35rem, 80vw);
            --TamañoREM: calc( var(--Tamaño) / 35 );

            background: linear-gradient( 315deg, var(--Color_Secundario), var(--Color_Secundario_Complementario) );
            border-radius: calc( var(--TamañoREM) * 1 );
            width: var(--Tamaño);
            height: calc( var(--TamañoREM) * 15 );
            z-index: 1;

        }

        div.Perfil {

            position: relative;
            width: calc( var(--TamañoREM) * 10 );
            height: calc( var(--TamañoREM) * 10 );
            top: calc( var(--TamañoREM) * -5 );
            left: calc( var(--TamañoREM) * 12.5 );
            border-radius: calc( var(--TamañoREM) * 10 );
            border: solid calc( var(--TamañoREM) * 0.15 ) var(--Color_Blanco);
            overflow: hidden;

        }

        div.Perfil img {

            width: calc( var(--TamañoREM) * 9.2 );
            height: calc( var(--TamañoREM) * 9.2 );
            border-radius: calc( var(--TamañoREM) * 10 );
            border: solid calc( var(--TamañoREM) * 0.4 ) transparent;
            overflow: hidden;

        }

        div.Instagram div.P {
            display: flex;
            align-items: end;
            overflow: hidden;
            max-height: calc( var(--TamañoREM) * 7.75 );
            height: auto;
            position: relative;
            top: calc( var(--TamañoREM) * -3.5 );
        }

        div.Instagram div.P p {

            font-family: monospace;
            color: var(--Color_Blanco);
            font-size: calc( var(--TamañoREM) * 1.25 );
            text-align: center;
            margin: 0px;
            width: 100%;
            white-space: pre;

        }

        div.Chat {
            position: fixed;
            width: calc( 100% - 4rem );
            height: calc( 100% - 4rem );
        }

        div.Chat div.messages {
            height: calc( 100% - 4rem );
            background: var(--Color_Secundario);
            overflow-x: hidden;
            overflow-y: auto;
        }

        div.Chat div.messages p {
            color: var(--Color_Blanco);
            font-family: Arial;
            margin: 1rem 1rem 1rem auto;
            width: fit-content;
            height: fit-content;
            padding: 1rem;
            background: var(--Color_Primario);
            max-width: calc( 100% - 10rem );
        }

        div.Chat div.messages p.you {
            margin: 1rem auto 1rem 1rem;
        }

        div.Chat input {
            width: calc( 100% - 1rem );
            padding: 0.5rem;
            border: none;
            height: 1.5rem;
            font-size: 1.25rem;
            margin-bottom: 1.5rem;
            background: var(--Color_Secundario_Complementario);
            color: var(--Color_Blanco);
            outline: none;
        }

    </style>

</head>
<body>

    <div id="stars"></div>
    <div id="stars2"></div>
    <div id="stars3"></div>

    <div class="Instagram">
        <div class="Perfil">
            <img src="Foto Perfil.jpg" title="Click para ir al perfil de Instagram" onclick="location.assign('https://www.instagram.com/da.go.le/')">
        </div>
        <div class="P">
            <p></p>
        </div>
    </div>

    <div class="Chat" hidden>
        <form onsubmit="event.preventDefault(); Escribir(document.querySelector('div.Chat input').value); document.querySelector('div.Chat input').value = '';">
            <input type="text">
        </form>
        <div class="messages">

        </div>
    </div>

    <script src="Preguntas.js"></script>

    <script>

        let Escribir = (mensaje = "HOLA", Emisor = "you") => {

            let mensajeP = document.createElement("p");
            mensajeP.className = Emisor;
            mensajeP.innerText = mensaje;
            document.querySelector("div.Chat div.messages").appendChild(mensajeP);
            document.querySelector("div.Chat div.messages").scrollTop = document.querySelector("div.Chat div.messages").scrollHeight - document.querySelector("div.Chat div.messages").offsetHeight;

            if (Emisor == "you") {
                if ( Preguntas[mensaje] ) {
                    if (typeof Preguntas[mensaje] == "string") Escribir(Preguntas[mensaje], "me");
                    else {
                        let RespuestaAleatoria = Math.ceil(Math.random() * Preguntas[mensaje].length) - 1;
                        Escribir(Preguntas[mensaje][RespuestaAleatoria], "me");
                    }
                }
                else Escribir("Lo siento para eso no tengo respuesta jaja", "me")
            }
